import React from "react";


// Needs to create a whole new model with each project for?
function Projects() {
  function openFile(e) {
    e.preventDefault();
    console.log('clicked');
  }
  return (
    <section className="my-2">
      <div className="modal-dialog">
        <div className="modal-content " style={{ background: "#F8F8FF" }}>
          <div className="modal-header">
            <h2 className="modal-title"> Title</h2>
            <button className="btn-close"></button>
          </div>
          <div className="modal-body" target="_blank" rel="noreferrer noopener">
            <ol>
              <li>
                {" "}
                <a >
                  {" "}
                  App Tool-Kit
                </a>
              </li>
            </ol>
          </div>
          <div className="modal-footer">
            <button onClick={{ openFile }}><a className="button btn btn-primary" href="https://lrivales.github.io/app-toolkit/" target="_blank" rel="noreferrer noopener">Open </a></button>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Projects;
